import {
    Box,
    Text
} from "@primer/react"
import Keyboard from "./Keyboard";

const spacing = 4;

const Notification = (props) => {
    return (
        <Box display="flex" width="100%" flexDirection="column" p={spacing}>
            <Box width="100%" display="flex" justifyContent="space-between" bg="red">
                <Text as="p" flex="0 0 100%" bg="pink">{props.repo || 'github/repo #375'}</Text>
                <Text as="inline-block" fontSize="12px" mr="2">{props.time || "1 hour ago"}</Text>
            </Box>
            <Box display="flex" width="100%">
                <Text as="p">{props.title || "Introduce new notifications"}</Text>
            </Box>
        </Box>
    )
}

export default Notification;
